import React from 'react'
import Form from 'react-bootstrap/Form'
import { useState, useEffect } from 'react'

const Country = () => {
const [data, setData] = useState([]);
const [searchCountries, setSearchCountries] = useState("");
const getdata = async () => {

const res = await fetch('https://disease.sh/v3/covid-19/countries/', {
method: 'GET',
body: JSON.stringify(),
headers: { 'Content-Type': 'application/json' }
})

const actdata = await res.json();
console.log(actdata);
setData(actdata);
}

useEffect (()=>{
getdata();
},[])

const filterCountries = data.filter(item =>{
return searchCountries !=="" ? item.country.includes(searchCountries) : item;
});

const countries = filterCountries.map((data, i)=>{
return (
<div>
  <div className=' card col-md-lg-4 bg-light text-dark text-center m-2 ' key={i}>
    <Card.Img variant='top' src={data.countryInfo.flag} />
    <div className='card-body'>
      <div className='card-title fw-bold'> {data.country} </div>
      <div className='card-text'>Deaths {data.deaths}</div>
      <div className='card-text'>Recovered {data.recovered}</div>
      <div className='card-text'>Today's cases {data.todayCases}</div>
      <div className='card-text'>Active {data.active}</div>
      <div className='card-text'>Critical {data.critical}</div>
      <div className='card-text'>Cases {data.cases}</div>

    </div>
  </div>
</div>
)
})


return (
<>
    <div className='container container-fluid mt-5 p-5'>
        <div className='main-heading'>
            <h1 className='mb-2 text-center'> Country wise COVID-19 Dashboard</h1>
        </div>
    </div>

    <Form className='d-flex justify-content-center  p-3'>
        <Form.Group className=" mb-3 row" controlId="formGroupSearch">

            <select className="form-select col-sm-10" aria-label="Default select example">
                <option selected="">Select Country</option>
                {
                data.map((curEle)=>{
                return(
                <option> {curEle.country} </option>
                )
                })
                }
            </select>
        </Form.Group>
    </Form>
    <div className=' table-responsive  mx-50px' style={{height:'20em'}}>
        <table id="table" className='table shadow p-3 mb-5 bg-body rounded table-striped '>

            <thead className='bg-dark text-white sticky-top'>
                <tr>
                    <th>S.N</th>
                    <th>Countries</th>
                    <th>Active </th>
                    <th>Recovered</th>
                    <th>Population</th>
                    <th>Death</th>
                    <th>Updated</th>
                </tr>
            </thead>
            <tbody>

                {
                data.map((curEle,index)=>{
                return(
                <tr key={index}>
                    <td>{index +1}</td>
                    <td>{curEle.country}</td>
                    <td>{curEle.active}</td>
                    <td>{curEle.recovered}</td>
                    <td>{curEle.population}</td>
                    <td className=''>{curEle.deaths}</td>
                    <td>{curEle.updated}</td>
                </tr>
                )
                })
                }

            </tbody>
        </table>
    </div>
</>
)
}

export default Country
